import { configureStore } from "@reduxjs/toolkit";

import userReducer from "./user";

const store = configureStore({
    //middleware: (getDefaultMiddleware) => getDefaultMiddleware().concat(logger), //middleware para --> que me loggee cada actualización//

    reducer: {
        user: userReducer,
    },
});

export default store;
